import React from 'react';
import styled from 'styled-components'

export default function Sidebar () {

    const SideNav = styled.div`
        width:5rem;
        height:100vh;
        position:fixed;
        display:flex;

    `

    const NavList = styled.ul`
        background-color:var(--p-3);

    `

    return (
            <SideNav>
                <NavList>
                </NavList> 
            </SideNav>
    )
}
